}
</style>
</head>
<body>

<div class="coupon">
  <div class="container">
    <h3>The Swift Eagle</h3>
  </div>
  <img src="data:image/jpeg;base64," alt="Avatar" style="width:100%;">
  <div class="container" style="background-color:white">
    <h2><b>FREE Ride for first 100 rides of the app</b></h2> 
    <p>Swift Eagle offers you a free ride if you are one of our first 100 users!!</p>
  </div>
  <div class="container">
    <p>Use Promo Code: <span class="promo">BOH232</span></p>
