  </div>
</div>
<div class="coupon">
  <div class="container">
    <h3>Swift Eagle</h3>
  </div>
    <img src="data:image/jpeg;base64," alt="Avatar" style="width:100%;">
  <div class="container" style="background-color:white">
    <h2><b>20% offer</b></h2> 
    <p>If</p>
  </div>
  <div class="container">
    <p>Use Promo Code: <span class="promo">COH456</span></p>
    <p class="expire">You can avail it if you are riders in between 1000 to 1100</p>
  </div>
</div>

</body>
</html> 
